INSERT INTO `retailer` VALUES (1,'GearVN','https://theme.hstatic.net/1000026716/1000440777/14/logo.svg?v=19182','https://www.facebook.com/gearvnhcm/','https://gearvn.com','GEARVN - Địa chỉ trải nghiệm các sản phẩm Gaming Gear - PC Hi-End cao cấp hàng đầu tại Việt Nam. Khởi đầu khiêm tốn từ mong ước của một game thủ muốn các bạn cùng sở thích dễ dàng có được dàn máy và gear mình yêu thích, GEARVN đã bứt phá trở thành một trong những nhà bán lẻ IT hàng đầu tại Việt Nam. '),(2,'HanoiComputer','https://hanoicomputercdn.com/media/lib/logo-trang.png','https://www.facebook.com/www.hanoicomputer.vn/','https://www.hanoicomputer.vn','HANOICOMPUTER, thành lập tháng 09 năm 2001, là một trong những doanh nghiệp tiên phong trong lĩnh vực Công nghệ thông tin tại Hà Nội'),(3,'AnPhatPC','https://anphat.com.vn/media/banner/logo_logo.png','https://www.facebook.com/anphatcomputer/','https://www.anphatpc.com.vn','An Phát được thành lập ngày 29/03/2004. Sau hơn 15 năm hoạt động, hiện nay quy mô Công ty phát triển hơn 200 nhân viên với trung tâm phân phối, trung tâm dự án và siêu thị bán lẻ máy tính tại Hà Nội và Hồ Chí Minh');
/*!40000 ALTER TABLE `retailer` ENABLE KEYS */;
